import React from 'react';

const SlotM = (props) => {
    // let x = 'ðŸ˜„';
    // let y = 'ðŸ˜„';
    // let z = 'ðŸŽ…';
 
    // let x = props.x;
    // let y =props.y;
    // let z = props.z;

    //object destructuring
    let {x,y,z} = props;
 
    if ((x === y) && (y === z)) {
       return (
          <>
             <div className="slot_inner">
                <h1> {x} {y} {z}  </h1>
                <h1> This is Maching. </h1>
                <hr />
             </div>
          </>
       );
    } else {
       return (
          <>
             <div className="slot_inner">
                <h1> {x} {y} {z}  </h1>
                <h1> This is Not Maching. </h1>
                <hr />
             </div>
          </>
       );
    }
 }

 export default SlotM;
